  false,\n\t\"url\": null,\n\t\"notes\": \"The Minerals Management Service (MMS) awarded
  a contract to Science Applications International Corporation (SAIC) to conduct a
  four-year study titled: Exploratory Study of Deepwater Currents in the Gulf of Mexico
  (often referred to as simply the Exploratory Study).nnThe Exploratory Study field
  measurement program as called for in the RFP and designed by SAIC's team had three
  primary objectives:nnA) Increase the deeepwater current database and knowledge of
  deep circulation in the GOM,nnB) Collect measurements sufficient to estimate parameters
  needed to design full-scale PO studies in deepwater regions of the GOM, andnnC)
  Collect current data to test several hypothesis.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
